import React, { useState } from "react";

const SignUp = (props) => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  const onSubmit = useCallback(
    (e) => {
      e.preventDefault();
      /**검증 로직 만들기
       * 1. 비밀번호와 비밀번호 체크가 다를 경우를 검증한다
       * 2. 약관 동의를 확인한다.
       */
      if (password !== passwordCheck) {
        return setPasswordError(true);
      }
      if (!term) {
        return setTermError(true);
      }

      //useCallback 하면 state 들을 dependence 배열에 넣어줍니다.
      //그래야 dependence 가 바뀔때 이벤트 함수가 생성이됩니다.
    },
    [password, passwordCheck, term]
  );
  return (
    <>
      <h2>회원가입</h2>
      <form className="form" action="index.html" method="">
        <div>
          <label>이메일</label>
          <input name="user-email" type="email" placeholder="이메일 주소" />
          <button type="submit">중복확인</button>
        </div>
        <div>
          <label>비밀번호</label>
          <input name="user-password" type="password" placeholder="비밀번호" />
        </div>
        <div>
          <label>비밀번호 확인</label>
          <input name="user-email" type="email" placeholder="비밀번호 확인" />
        </div>
        <div>
          <label>이름</label>
          <input name="user-name" type="text" placeholder="이름(본명)" />
        </div>
        <div>
          <label>닉네임</label>
          <input name="user-nickname" type="text" placeholder="닉네임(별명)" />
          <button type="submit">중복확인</button>
        </div>
        <div>
          <button>돌아가기</button>
          <button type="submit">가입하기</button>
        </div>
      </form>
    </>
  );
};

export default SignUp;
